          </ProtectedRoute>
        } 
      />
      <Route 
        path="/hr-suite/employee-analytics" 
        element={
          <ProtectedRoute requiredRole="user">
            <DashboardLayout>
              <EmployeeAnalytics />
            </DashboardLayout>
          </ProtectedRoute>
        } 
      />
      <Route 
        path="/hr-suite/attendance" 
        element={
          <ProtectedRoute requiredRole="user">
            <DashboardLayout>
              <Attendance />
            </DashboardLayout>
          </ProtectedRoute>
        } 
      />
      <Route 
        path="/hr-suite/payroll-dashboard" 
        element={
          <ProtectedRoute requiredRole="user">
            <DashboardLayout>
              <PayrollDashboard />
            </DashboardLayout>
          </ProtectedRoute>
        } 
      />
      <Route 
        path="/hr-suite/esign" 
        element={
          <ProtectedRoute requiredRole="user">
            <DashboardLayout>
              <Esign />
            </DashboardLayout>
          </ProtectedRoute>
        } 
      />
      <Route 
        path="/hr-suite/onboarding-documents" 
        element={
          <ProtectedRoute requiredRole="user">
            <DashboardLayout>
              <OnboardingDocuments />
            </DashboardLayout>
          </ProtectedRoute>
        } 
      />

      {/* Super Admin Routes */}
      <Route 
        path="/tenants/management/info" 
        element={
          <ProtectedRoute requiredRole="user">
            <DashboardLayout>
              <TenantsInfo />
            </DashboardLayout>
          </ProtectedRoute>
        } 
      />
      <Route 
        path="/tenants/management/actions" 
        element={
          <ProtectedRoute requiredRole="user">
            <DashboardLayout>
              <Actions/>
            </DashboardLayout>
          </ProtectedRoute>
        } 
      />
      <Route 
        path="/tenants/management/details" 
        element={
          <ProtectedRoute requiredRole="user">
            <DashboardLayout>
              <TenantDetailsPage />
            </DashboardLayout>
          </ProtectedRoute>
        } 
      />
      <Route 
        path="/plans/credits/list" 
        element={
          <ProtectedRoute requiredRole="user">
            <DashboardLayout>
              <PlansList />
            </DashboardLayout>
          </ProtectedRoute>
        } 
      />
      <Route 
        path="/plans/credits/allocation" 
        element={
          <ProtectedRoute requiredRole="user">
            <DashboardLayout>
              <CreditsAllocation/>
            </DashboardLayout>
          </ProtectedRoute>
        } 
      />
      <Route 
        path="/plans/credits/usage-tracking" 
        element={
          <ProtectedRoute requiredRole="user">
            <DashboardLayout>
              <UsageTracking/>
            </DashboardLayout>
          </ProtectedRoute>
        } 
      />
      <Route 
        path="/system/health/errors" 
        element={
          <ProtectedRoute requiredRole="user">
            <DashboardLayout>
              <APIErrors />
            </DashboardLayout>
          </ProtectedRoute>
        } 
      />
      <Route 
        path="/system/health/uptime" 
        element={
          <ProtectedRoute requiredRole="user">
            <DashboardLayout>
              <Uptime/>
            </DashboardLayout>
          </ProtectedRoute>
        } 
      />
      <Route 
        path="/system/health/usage" 
        element={
          <ProtectedRoute requiredRole="user">
            <DashboardLayout>
              <Usage/>
            </DashboardLayout>
          </ProtectedRoute>
        } 
      />
      <Route 
        path="/feature/flags/description" 
        element={
          <ProtectedRoute requiredRole="user">
            <DashboardLayout>
              <Description />
            </DashboardLayout>
          </ProtectedRoute>
        } 
      />
      <Route 
        path="/feature/flags/toggle-switch" 
        element={
          <ProtectedRoute requiredRole="user">
            <DashboardLayout>
              <ToggleSwitch/>
            </DashboardLayout>
          </ProtectedRoute>
        } 
      />
      <Route 
        path="/feature/flags/target-tenants" 
        element={
          <ProtectedRoute requiredRole="user">
            <DashboardLayout>
              <TargetTenants/>
            </DashboardLayout>
          </ProtectedRoute>
        } 
      />
      <Route 
        path="/feature/flags/rollout-status" 
        element={
          <ProtectedRoute requiredRole="user">
            <DashboardLayout>
              <RollOutStatus/>
            </DashboardLayout>
          </ProtectedRoute>
        } 
      />
      
      {/* Super Admin Routes */}
      <Route 
        path="/super-admin" 
        element={
          <ProtectedRoute superAdminOnly={true}>
            <DashboardLayout>
              <SuperAdminDashboard />
            </DashboardLayout>
          </ProtectedRoute>
        } 
      />
    </Routes>
  );
};

export default AppRoutes;
